import { Layout, Heading } from "../../components";
import { Calendar, User } from "./";
import { Dash_View_Players_Styles } from "./Dash_Styles";
import { Team_Schedule } from "./Team";
const { Container } = Layout;

const billing = () => {
  return <Container>content</Container>;
};

const schedule = () => {
  return (
    <Container>
      <Heading style={{ textAlign: "right", borderBottom: "1px solid black" }}>
        Calendar
      </Heading>
      <Calendar />
    </Container>
  );
};

const players = () => {
  return (
    <Container>
      <Dash_View_Players_Styles className="PlayerView_Overview_Containe">
        <div>
          <User.PlayerAddButton />
          <User.PlayerOverview />
          <User.PlayerOverview />
          <Team_Schedule />
        </div>
      </Dash_View_Players_Styles>
    </Container>
  );
};

const contact = () => {
  return <Container>content</Container>;
};
const Admin_View = {
  billing,
  schedule,
  contact,
  players,
};

const User_View = {
  billing,
  schedule,
  contact,
  players,
};

const Dash_Views = {
  Admin_View,
  User_View,
};

export default Dash_Views;
